PocketBook Reader is a free app for reading all formats (books, magazines, textbooks, comic books, etc.) and listening to audiobooks! The application supports 26 book and audio formats, including mobi, epub, fb2, cbz, cbr. Read without ads and with total comfort!

Choose any content - any format!
• Support of 19 book formats, including the most popular - EPUB, FB2, MOBI, PDF, DJVU, DOCX, RTF, TXT, HTML;
• Comic book formats CBR and CBZ;
• Open books protected with Adobe DRM (PDF, EPUB);
• PDF Reflow function (reflow text in PDF files).

Listen to audiobooks!
• You can listen to audiobooks and other audio files in MP3, M4B, and take notes in them;
• Built-in TTS (Text-to-speech) engine for the voicing of the text files. 

Download and sync content easily!
• Free PocketBook Cloud service for synchronizing all your books, including audiobooks, as well as reading positions, notes and bookmarks on all your devices;
• Your files from Dropbox or Google Books services are easily connected to the app to create one consolidated library. You can even connect multiple accounts at the same time;
• Support for OPDS catalogs - get access to network libraries;
• ISBN scanner, for quick search of electronic versions of books by barcode;
• Opportunity to borrow books and periodicals;
• If you have a E Ink e-reader PocketBook, you can easily synchronize all your books and accounts just by scanning a QR code.

Ready to switch from another app? No problem! Getting started with PocketBook Reader is easy! With an intuitive interface, the application provides you with unprecedented freedom – lots of options for settings and no restrictions.

Choose, change, customize, and personalize!
• Intuitive interface, easy navigation, and minimalistic design;
• Opportunity to choose one of the seven interface color themes, reassign the buttons and display areas;
• Two night-reading modes - for better reading comfort anytime;
• Adjust the font style, font size, line spacing, and margin size;
• Animation of turning pages;
• Opportunity to crop margins – make the page look exactly the way you want.

Get fast file access and easy search!
• All files are quickly found and instantly opened, even with built-in audio and video fragments;
• Your books will never be lost in the device’s memory - thanks to the smart search, scanning files on your tablet or smartphone is a matter of seconds. Any file or document can be found in a few clicks!
• The app allows you to sort books, create collections, filter and mark files as you like. Your library - your rules;
• Convenient managing  of audio files - it is easy to sort and play your audiobooks.

Make bookmarks, take notes, add comments!
• You can quickly find all your notes and share them with friends via email or messengers;
• Collect all your notes, bookmarks, and comments into separate files for even greater convenience.

PocketBook Reader was created by avid readers for avid readers, and that’s why it’s probably the best e-book reader app.

Jean-Frédéric Osterwald (ou Ostervald) (25 Novembre 1663 à 1614 Avril, 1747), pasteur protestant suisse, est né à Neuchâtel en 1663 dans une famille patricienne, un fils du pasteur réformé Johann Rudolf Ostervald. Il a étudié à Zurich et à Saumur (où il a obtenu), étudia la théologie à Orléans, sous Claude Pajon, à Paris sous Jean Claude et à Genève sous Louis Tronchin, et a été ordonné au ministère dans sa ville natale en 1683.

Français Bible Ostervald, une révision de la traduction française, en particulier, a longtemps été connue et très appréciée en Grande-Bretagne.

Avantages de l'application:
- L'application fonctionne sans connexion Internet (hors ligne);
- Possibilité de rechercher;
- Possibilité pour augmenter / diminuer la police;
- Possibilité de créer un nombre illimité d'onglets à un verset particulier, l'un des livres;
- Si vous êtes intéressé à la répartition des poèmes que vous pouvez copier ou envoyer un message;
- Possibilité de faire défiler les boutons de volume.
Notre équipe est pas en place, et vise à élargir ses applications fonctionnelles.

Mode d'emploi:
Chaque élément de menu est un livre séparé, et chaque page séparée dans l'un des livres est la tête.
Placez le curseur à la place du numéro de chapitre et entrez le numéro de chapitre. Ainsi, vous ne serez pas avoir à faire défiler tous les chapitres, la sélection intéressante.

